const PersonalProfile = () => {
    const data = {
        name: 'Julian Garcia',
        img: './Media/julianrun.JPG',
        description: 'Hello, my name is Julian Garcia and I am 25 years old.'
    }
    return (
        <div className="Profile">
                <ul>
                    <li>{data.name}</li>
                    <li>{data.img}</li>
                    <li>{data.description}</li>
                </ul>
        </div>
    )
}
